description:
Repo! The Genetic Opera! (2008)  

Verenigde Staten
Horror / Muziek
98 minuten

geregisseerd door Darren Lynn Bousman
met Anthony Head, Sarah Brightman en Paul Sorvino

Een sci-fi horror-musical die zich afspeelt in het jaar 2056, waarin de mensheid wordt geplaagd door een dodelijke ziekte. Enkel de rijken die een flinke som geld kunnen ophoesten, zijn in staat om via orgaantransplantatie in leven te blijven.


